import React from 'react'


const ReservationInfo = () => {

    return (

        <div className="container">
            <div className="card">

                <div className="card-content">

                    <span className="card-title">Rezervacija 1028</span>

                    <FlightReservation></FlightReservation>


                    <div className="card">

                        <div className="card-content">

                            <span className="card-title">Vozilo</span>

                            <p>Rezervacija kola</p>


                        </div>

                    </div>

                </div>

            </div>
        </div>

    );
};


export default ReservationInfo;
